import logo from './logo.svg';
import React, {Component} from 'react'
import './App.css';
import Table1 from './stories/Table1';

class App extends Component {
  render() {
    const characters = [
      {
        name: 'Charlie',
        job: 'Janitor',
      },
      {
        name: 'Mac',
        job: 'Bouncer',
      },
      {
        name: 'Dee',
        job: 'Aspring actress',
      },
      {
        name: 'Dennis',
        job: 'Bartender',
      },
    ]

  return (
    <div className="App">
      <header className="App-header">
        <div className="container">
        <Table1  characterData={ characters }/>
        </div>
      </header>
    </div>
  );
  }
}

export default App;
